import React from "react";

import './App.css';
import Header from './components/header'
//import Main from './components/main'
//import Footer from './components/footer' 
import Button from './components/buttons'

function App() {
  return (
    <div className="App">
      <Header />
      <main className="main">
        <Button /> 
      
      </main> 
      
    </div>
   
  );
}

export default App;
